import PropTypes from 'prop-types';
    
const Item = (props)=>{
    const {title,amount} = props
    if(amount < 0) {
        return (
            <li>{title}<span style={{color: 'red'}}>{amount}</span></li>
        );
    }
    else {
        return (
            <li>{title}<span>{amount}</span></li>
        );
    }
}

Item.propTypes={
    title:PropTypes.string.isRequired,
    amount:PropTypes.number.isRequired
}

export default Item
